.eqv BASE_ADDRESS 	0x10008000 # ($gp)
.eqv MAX_ADDRESS	0x10018000 
.eqv MAX_JUMP		16	# timer
.eqv MAX_TELEPORT	100	# x/4 pixels, where 'x' is this number
.eqv MAX_FIREBALL	40	# timer that counts until fireball finishes
.eqv MAX_ENEMY_MOVEMENT	25	# timer
.eqv MAX_ENEMY_FIREBALL	100	# timer
# control enemy's progression
.eqv GAME_TICK		8
# control frame rate
.eqv SLEEP		40

# colors for detection
.eqv PEACH		0xCA9F75
.eqv PLATFORM	0x3e3d4c # 0x94cc1c # 0x3f8a1e
.eqv SPIKE		0xDE3163
