.globl main
.text
main:
	li $t0, BASE_ADDRESS 	# store character position
	j set_start_screen

	#li $t0, BASE_ADDRESS
	#addi $a0, $t0, 33012		# current position
	#move $a1, $a0		 	# new pzosition
	#lw $a2, 20($a0)		# color after end of character - 4 * (7 + 1) pixels behind
	#jal hero_standing		# draw character's initial position

switch_screen:
	lw $t4, level
	beqz $t4, set_start_screen
	li $t9 1
	beq $t4, $t9, set_level1
	li $t9 2
	beq $t4, $t9, set_level2
	li $t9 3
	beq $t4, $t9, set_level3
	li $t9, 4
	beq $t4, $t9, set_win_screen
	li $t9, -1
	beq $t4, $t9, set_lose_screen
	li $t9, -2
	beq $t4, $t9, set_levels
	
	j resume

resume:
	#lw $t2, tick
	#add $t2, $t2, -1
	#sw $t2, tick
	
	li $v0, 32	# sleep
	li $a0, SLEEP
	syscall

	li $s7, 0xffff0000
	lw $s6, 0($s7)
	beq $s6, 1, keypress_happened
	
	lw $t2, moving			# continue moving in direction if no key pressed
	beqz $t2, else
	lw $t2, direction 
	beqz $t2, move_left
	beq $t2, 1, move_right
	
	j check_start_screen

keypress_happened:
	lw $t9, 4($s7) 			# this assumes $s7 is set to 0xfff0000 from before
	
	beq $t9, 0x70, restart 		# restart game when 'p' is pressed
	li $a0, 1					# user pressed jump key
	beq $t9, 0x77, jump 		# ASCII code of 'w' is 0x77 or 119 in decimal
	beq $t9, 0x73, stop_moving 	# ASCII code of 's' is 0x73 or 115 in decimal
	beq $t9, 0x61, move_left 	# ASCII code of 'a' is 0x61 or 97 in decimal
	beq $t9, 0x64, move_right 	# ASCII code of 'd' is 0x64 or 100 in decimal
	beq $t9, 0x20, space		# ASCII code of ' ' (space)
	beq $t9, 0x6C, l			# ASCII code of 'l'
	beq $t9, 0x08, backspace	# ASCII code of 'backspace'
	beq $t9, 0x31, levels		# ASCII code of '1'
	beq $t9, 0x32, levels		# ASCII code of '2'
	beq $t9, 0x33, levels		# ASCII code of '3'

	j check_start_screen

space:
	lw $s1, level
	beqz $s1, start_screen	# either player is choosing
	li $s0, 4
	beq $s1, $s0, win	# player has won the game
	li $s0, -1
	beq $s1, $s0, lose	# player has lost the game
	j use_powerups	# player is using powerups

l:
	li $s1, -2
	sw $s1, level
	j restart

backspace:
	sw $zero, level
	j restart

win:
	sw $zero, level
	li $t9, 3
	sw $t9, lives
	j restart
	
lose:
	li $t9, 1
	sw $t9, level
	li $t9, 3
	sw $t9, lives
	j restart

next_level:
	lw $t9, level
	addi $t9, $t9, 1
	sw $t9, level
	li $s0, 4
	beq $t9, $s0, set_win_screen
	j restart

hit:
	lw $t9, lives
	add $t9, $t9, -1
	sw $t9, lives
	beqz $t9, update_lives

	j restart

	update_lives:
	li $t9, -1
	sw $t9, level
	j restart

restart:
	li $t9, 1
	sw $t9, direction
	sw $t9, enemy_movement+8
	li $t9, -1
	sw $t9, hero_fireball+4
	sw $t9, hero_fireball+8
	sw $t9, enemy_fireball+4
	sw $t9, enemy_fireball+8
	sw $t9, enemy_movement
	sw $zero, enemy_movement+4	# erases enemy position
	sw $zero, moving
	sw $zero, jump_cycle
	sw $zero, hero_fireball
	sw $zero, enemy_fireball
	sw $zero, curr_powerup
	j switch_screen

else:	
	#lw $t2, tick
	#bgtz $t2, resume
	#li $t2, GAME_TICK
	#sw $t2, tick

	# order: jump/gravity -> check_fireball -> check_enemy & check_enemy_fireball -> NO MOVING PLATFORMS :(
	
	lw $t2, jump_cycle
	li $a0, 0			# user did not press jump key
	bgtz $t2, jump		# jump in progress
	
	j gravity
	
check_start_screen:
	lw $t7, level
	beqz $t7, start_screen
	j else

check_enemy:
	li $a0, BASE_ADDRESS
	la $a1, enemies
	lw $a2, enemies_length
	lw $a3, level

	lw $t2, enemy_movement
	bgez $t2, draw_enemies
	lw $t2, enemy_fireball+8
	bgez $t2, draw_enemies

	j resume

check_fireball:
	lw $t2, hero_fireball+4
	li $a0, 1
	bgez $t2, use_fireball

	j check_enemy

remove_selected:
	# remove previous selected answer
	li $s1, BASE_ADDRESS
	la $s2, start_menu
	add $s0, $s1, 25600
	add $s2, $s2, 25600
	add $s1, $s1, 31744
	paint_white:		# load values from array and print to screen
	lw $s3, ($s2)
	sw $s3, ($s0)
	add $s0, $s0, 4
	add $s2, $s2, 4
	bne $s0, $s1, paint_white
	jr $ra

start_screen:
	# choose selected answer based on position on screen
	li $s0, 512
	add $s1, $t0, 24		# get y location
	div $s1, $s0
	mfhi $s0

	ble $s0, 200, choose_levels		# check if y coordinate is less than value
	ble $s0, 368, choose_start
	ble $s0, 508, choose_quit

	# levels option
	choose_levels:
	lw $s0, selected_screen			# check if levels option is already selected
	li $s1, 1
	beq $s0, $s1, switch_levels
	sw $s1, selected_screen
	jal remove_selected				# remove old selection

	li $s0, BASE_ADDRESS
	li $s3, 512
	add $s1, $s0, 31744
	add $s0, $s0, 25600
	choose_levels_loop:
	div $s0, $s3
	mfhi $s4
	li $s5, 200
	beq $s4, $s5, choose_levels_nextline	# if at end of line, skip down to next line

	lw $s6, ($s0)							# get pixel color
	li $s7, 0xFFFFFF
	beq $s6, $s7, paint_levels_green		# if pixel is white, paint it green
	j choose_levels_continue
	paint_levels_green:
	li $s7, CHOICE_COLOR
	sw $s7, ($s0)
	choose_levels_continue:
	add $s0, $s0, 4
	j choose_levels_normal
	choose_levels_nextline:
	add $s0, $s0, 312
	choose_levels_normal:
	ble $s0, $s1, choose_levels_loop
	switch_levels:
	beq $t9, 0x20, set_levels
	j else

	# start option
	choose_start:
	lw $s0, selected_screen			# check if start option is already selected
	li $s1, 2
	beq $s0, $s1, switch_start
	sw $s1, selected_screen
	jal remove_selected				# remove old selection

	li $s0, BASE_ADDRESS
	li $s3, 512
	add $s1, $s0, 31744
	add $s0, $s0, 25808
	choose_start_loop:
	div $s0, $s3
	mfhi $s4
	li $s5, 368
	beq $s4, $s5, choose_start_nextline	# if at end of line, skip down to next line

	lw $s6, ($s0)						# get pixel color
	li $s7, 0xFFFFFF
	beq $s6, $s7, paint_start_green		# paint the pixel green if its white
	j choose_start_continue
	paint_start_green:
	li $s7, CHOICE_COLOR
	sw $s7, ($s0)
	choose_start_continue:
	add $s0, $s0, 4
	j choose_start_normal
	choose_start_nextline:
	add $s0, $s0, 352
	choose_start_normal:
	ble $s0, $s1, choose_start_loop
	switch_start:
	beq $t9, 0x20, set_level1
	j else

	# quit option
	choose_quit:
	lw $s0, selected_screen			# check if quit option is already selected
	li $s1, 3
	beq $s0, $s1, switch_quit
	sw $s1, selected_screen
	jal remove_selected				# remove old selection

	li $s0, BASE_ADDRESS
	li $s3, 512
	add $s1, $s0, 31744
	add $s0, $s0, 25968
	choose_quit_loop:
	div $s0, $s3
	mfhi $s4
	li $s5, 508
	beq $s4, $s5, choose_quit_nextline	# if at end of line, skip down to next line

	lw $s6, ($s0)						# get pixel color
	li $s7, 0xFFFFFF
	beq $s6, $s7, paint_quit_green		# paint the pixel green if its white
	j choose_quit_continue
	paint_quit_green:
	li $s7, CHOICE_COLOR
	sw $s7, ($s0)
	choose_quit_continue:
	add $s0, $s0, 4
	j choose_quit_normal
	choose_quit_nextline:
	add $s0, $s0, 372
	choose_quit_normal:
	ble $s0, $s1, choose_quit_loop
	switch_quit:
	beq $t9, 0x20, final
	j else
	
levels:
	lw $s0, level
	li $s1, -2
	bne $s0, $s1, resume	# if levels is not on screen, do nothing

	# else jump to corresponding level
	beq $t9, 0x31, set_level1		# ASCII code of '1'
	beq $t9, 0x32, set_level2		# ASCII code of '2'
	beq $t9, 0x33, set_level3		# ASCII code of '3'
	j switch_screen

use_powerups:
	lw $s0, curr_powerup
	li $s1, 2
	beq $s0, $s1, use_teleport
	li $s1, 3
	li $a0, 1
	beq $s0, $s1, use_fireball
	j resume

doublejump:
	li $s0, 1
	sw $s0, curr_powerup	# update powerup

	jal powerup_text

	li $a0, BASE_ADDRESS
	la $a1, powerups
	lw $a2, powerups_length
	lw $a3, level
	j clear_powerup

teleport:
	li $s0, 2
	sw $s0, curr_powerup	# update powerup

	jal powerup_text

	li $a0, BASE_ADDRESS
	la $a1, powerups
	lw $a2, powerups_length
	lw $a3, level
	j clear_powerup

use_teleport:
	lw $s0, direction	# character direction
	beqz $s0, teleport_left
	beq $s0, 1, teleport_right
	j else

teleport_right:
	# erase left
	lw $t9, 0($t1) 		# load value from array at address and write to screen
	sw $t9, 0($t0)
	lw $t9, 516($t1)
	sw $t9, 516($t0)
	lw $t9, 1024($t1)
	sw $t9, 1024($t0)

	# erase character
	add $s0, $t0, 8
	add $s1, $t1, 8
	li $s3, 8
	clear_height_right:
	li $s2, 7

	clear_width_right:
	lw $s4, ($s1)
	sw $s4, ($s0)

	add $s0, $s0, 4		# clear next pixel
	add $s1, $s1, 4
	add $s2, $s2, -1
	bnez $s2, clear_width_right

	add $s0, $s0, 484	# clear next line
	add $s1, $s1, 484
	add $s3, $s3, -1
	bnez $s3, clear_height_right

	# used for edge detection
	li $s7, 512
	
	# only teleport until the end of the screen
	add $s3, $t0, 36
	add $s4, $t1, 36
	li $s1, MAX_TELEPORT	# counter
	check_teleport_right_boundary:
	li $s2, 8
	move $s6, $s3
	check_tp_right_boundary:		# check color right of character
	lw $s0, ($s6)
	div $s6, $s7		# hero pos
	mfhi $t9
	beqz $t9, update_teleport_right		# screen detection
	li $t8, 0xb4e3dd
	add $s6, $s6, 512
	add $s2, $s2, -1
	bnez $s2, check_tp_right_boundary
	addi $s3, $s3, 4	# update character position
	addi $s4, $s4, 4	# update bg screen position
	add $s1, $s1, -1
	bnez $s1, check_teleport_right_boundary

	add $t0, $t0, MAX_TELEPORT
	add $t1, $t1, MAX_TELEPORT

	# teleport all the way ahead if there's no wall
	# if there is, keep moving back until there isn't
	add $s3, $t0, 36
	add $s4, $t1, 36
	li $s1, MAX_TELEPORT	# counter
	check_teleport_right:
	li $s2, 8
	move $s6, $s3
	check_tp_right:		# check color right of character
	lw $s0, ($s6)
	div $s6, $s7		# hero pos
	mfhi $t9
	beqz $t9, update_teleport_right		# screen detection
	li $t8, 0xb4e3dd
	beq $s0, $t8, update_teleport_right
	add $s6, $s6, 512
	add $s2, $s2, -1
	bnez $s2, check_tp_right

	addi $s3, $s3, -4	# update character position
	addi $s4, $s4, -4	# update bg screen position
	add $s1, $s1, -1
	bnez $s1, check_teleport_right

	update_teleport_right:
	add $t0, $s3, -36
	add $t1, $s4, -36

	# character positions	
	move $a0, $t0
	move $a1, $t1
	
	jal hero_right

	# used for edge detection
	li $s7, 512
	
	li $s2, 8
	addi $s3, $t0, 36
	check_right_teleport:		# check color right of character
	lw $s0, ($s3)
	div $s3, $s7		# hero pos
	mfhi $t9
	beqz $t9, else		# screen detection
	beq $s0, DOUBLE_JUMP, doublejump	# check for doublejump powerup
	beq $s0, TELEPORT, teleport	# check for teleport powerup
	beq $s0, FIREBALL, fireball # check for fireball powerup
	beq $s0, PLATFORM, else # platform detection
	beq $s0, SPIKE, hit	# spike detection
	beq $s0, PORTAL, next_level	# portal detection
	beq $s0, PORTAL2, next_level
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_right_teleport
	
	j else

teleport_left:
	# erase right
	lw $t9, 0($t1) 		# load value from array and write to screen
	sw $t9, 0($t0)
	lw $t9, 508($t1)
	sw $t9, 508($t0)
	lw $t9, 1024($t1)
	sw $t9, 1024($t0)

	# erase character
	add $s0, $t0, -8
	add $s1, $t1, -8
	li $s3, 8
	clear_height_left:
	li $s2, 7

	clear_width_left:
	lw $s4, ($s1)
	sw $s4, ($s0)

	add $s0, $s0, -4		# clear next pixel
	add $s1, $s1, -4
	add $s2, $s2, -1
	bnez $s2, clear_width_left

	add $s0, $s0, 540	# clear next line
	add $s1, $s1, 540
	add $s3, $s3, -1
	bnez $s3, clear_height_left

	# used for edge detection
	li $s7, 512

	# only teleport until the end of the screen
	add $s3, $t0, -36
	add $s4, $t1, -36
	li $s1, MAX_TELEPORT	# counter
	check_teleport_left_boundary:
	li $s2, 8
	move $s6, $s3
	check_tp_left_boundary:		# check color left of character
	lw $s0, ($s6)
	div $s6, $s7		# hero pos
	mfhi $t9
	beqz $t9, update_teleport_left		# screen detection
	li $t8, 0xb4e3dd
	add $s6, $s6, 512
	add $s2, $s2, -1
	bnez $s2, check_tp_left_boundary
	addi $s3, $s3, -4	# update character position
	addi $s4, $s4, -4	# update bg screen position
	add $s1, $s1, -1
	bnez $s1, check_teleport_left_boundary

	add $t0, $t0, -MAX_TELEPORT
	add $t1, $t1, -MAX_TELEPORT
	
	# teleport all the way ahead if there's no wall
	# if there is, keep moving back until there isn't
	add $s3, $t0, -36
	add $s4, $t1, -36
	li $s1, MAX_TELEPORT	# counter
	check_teleport_left:
	li $s2, 8
	move $s6, $s3
	check_tp_left:		# check color left of character
	lw $s0, ($s6)
	div $s6, $s7		# hero pos
	mfhi $t9
	beqz $t9, update_teleport_left		# screen detection
	li $t8, 0xb4e3dd
	beq $s0, $t8, update_teleport_left
	add $s6, $s6, 512
	add $s2, $s2, -1
	bnez $s2, check_tp_left

	addi $s3, $s3, 4	# update character position
	addi $s4, $s4, 4	# update bg screen position
	add $s1, $s1, -1
	bnez $s1, check_teleport_left

	update_teleport_left:
	add $t0, $s3, 36
	add $t1, $s4, 36

	# character positions
	move $a0, $t0
	move $a1, $t1
	
	jal hero_left

	# used for edge detection
	li $s7, 512
	
	li $s2, 8
	addi $s3, $t0, -36
	check_left_teleport:		# check color left of character
	lw $s0, ($s3)
	div $s3, $s7		# hero pos
	mfhi $t9
	beqz $t9, else			# screen detection
	beq $s0, DOUBLE_JUMP, doublejump	# check for doublejump powerup
	beq $s0, TELEPORT, teleport	# check for teleport powerup
	beq $s0, FIREBALL, fireball # check for fireball powerup
	beq $s0, PLATFORM, else	# platform detection
	beq $s0, SPIKE, hit	# spike detection
	beq $s0, PORTAL, next_level	# portal detection
	beq $s0, PORTAL2, next_level
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_left_teleport

	j else

fireball:
	li $s0, 3
	sw $s0, curr_powerup	# update powerup

	jal powerup_text

	li $a0, BASE_ADDRESS
	la $a1, powerups
	lw $a2, powerups_length
	lw $a3, level
	j clear_powerup
	
use_fireball:
	jal get_level
	move $a3, $v0

	beqz $a0, load_enemy_fireball
	lw $a1, hero_fireball		# offset
	lw $a2, hero_fireball+4		# fireball duration
	lw $s1, hero_fireball+8		# get direction fireball is moving in
	lw $s0, direction			# else get character direction
	j load_fireball

	load_enemy_fireball:
	# t6 has player position
	lw $a1, enemy_fireball		# offset
	lw $a2, enemy_fireball+4	# fireball duration
	lw $s1, enemy_fireball+8	# get direction fireball is moving in
	move $s0, $s4

	load_fireball:
	beqz $s1, fireball_left
	bgtz $s1, fireball_right

	beqz $s0, fireball_left
	beq $s0, 1, fireball_right
	j check_enemy

fireball_right:	
	bltz $a2, start_fireball_right
	beqz $a2, clear_fireball_right
	bgtz $a2, update_fireball_right

	start_fireball_right:
	beqz $a0, start_enemy_fireball_right
	li $s7, MAX_FIREBALL
	sw $s7, hero_fireball+4
	li $s7, 1
	sw $s7, hero_fireball+8
	add $a1, $t0, 1572	# starting position of fireball
	j getting_fireball_level

	start_enemy_fireball_right:
	li $s7, MAX_ENEMY_FIREBALL
	sw $s7, enemy_fireball+4
	li $s7, 1
	sw $s7, enemy_fireball+8
	move $s0, $t6
	add $a1, $s0, 1060	# starting position of fireball
	j getting_fireball_level

	getting_fireball_level:
	li $s7, BASE_ADDRESS
	sub $s7, $a1, $s7	# get fireball offset
	add $a3, $a3, $s7	# add to current level

	draw_fireball_right:
	beqz $a0, draw_enemy_fireball_right
	sw $a1, hero_fireball
	li $s7, 3		# i = height
	la $t5, hero_projectile
	j fireball_height_right

	draw_enemy_fireball_right:
	sw $a1, enemy_fireball
	li $s7, 3		# i = height
	la $t5, enemy_projectile

	fireball_height_right:
	li $s6, 5		# j = width

	fireball_width_right:
	# draw $a0 at position $a1, filling up the gaps using $a3
	lw $s2, ($t5)
	beq $s2, 0x000000, fill_fireball_right
	sw $s2, ($a1)
	j continue_drawing_fireball_right
	fill_fireball_right:
	lw $s2, ($a3)
	sw $s2, ($a1)

	continue_drawing_fireball_right:
	add $t5, $t5, 4		# move to next pixel
	add $a1, $a1, 4
	add $a3, $a3, 4
		
	addi $s6, $s6, -1
	bnez $s6, fireball_width_right	# break if i == 0
	
	add $a1, $a1, 492	# move to next line
	add $a3, $a3, 492
	
	addi $s7, $s7, -1
	bnez $s7, fireball_height_right	# break if j == 0
	beqz $a0, next_enemy
	j check_enemy

	clear_fireball_right:
	beqz $a0, clear_enemy_fireball_right
	li $s1, -1
	sw $s1, hero_fireball+4
	sw $s1, hero_fireball+8
	sw $zero, hero_fireball
	j continue_clearing_right

	clear_enemy_fireball_right:
	li $s1, -1
	sw $s1, enemy_fireball+4
	sw $zero, enemy_fireball

	continue_clearing_right:
	li $s7, BASE_ADDRESS
	sub $s7, $a1, $s7	# get offset of fireball
	add $a3, $a3, $s7	# add to current level

	li $s7, 3		# i = height

	clear_fireball_height_right:
	li $s6, 5		# j = width

	clear_fireball_width_right:
	# get level and load to screen
	lw $s2, ($a3)
	sw $s2, ($a1)

	add $a1, $a1, 4		# move to next pixel
	add $a3, $a3, 4
		
	addi $s6, $s6, -1
	bnez $s6, clear_fireball_width_right	# break if i == 0
	
	add $a1, $a1, 492	# move to next line
	add $a3, $a3, 492
	
	addi $s7, $s7, -1
	bnez $s7, clear_fireball_height_right	# break if j == 0
	beqz $a0, next_enemy
	j check_enemy

	update_fireball_right:
	beqz $a0, update_enemy_fireball_right
	add $a2, $a2, -1
	sw $a2, hero_fireball+4
	j updated_fireball_right

	update_enemy_fireball_right:
	add $a2, $a2, -1
	sw $a2, enemy_fireball+4
	
	updated_fireball_right:
	# used for edge detection
	li $s7, 512
	
	li $s2, 3
	addi $s3, $a1, 20
	check_fireball_right:		# check color right of character
	lw $s5, ($s3)
	div $s3, $s7		# hero pos
	mfhi $t9
	beqz $t9, clear_fireball_right		# screen detection
	beq $s5, DOUBLE_JUMP, clear_fireball_right	# check for doublejump powerup
	beq $s5, TELEPORT, clear_fireball_right	# check for teleport powerup
	beq $s5, FIREBALL, clear_fireball_right # check for fireball powerup
	beq $s5, PLATFORM, clear_fireball_right # platform detection
	beq $s5, SPIKE, clear_fireball_right	# spike detection
	beq $s5, PORTAL, clear_fireball_right	# portal detection
	beq $s5, PORTAL2, clear_fireball_right
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_fireball_right

	li $s7, BASE_ADDRESS
	sub $s7, $a1, $s7	# get offset of fireball
	add $a3, $a3, $s7	# add to current level

	lw $s5, 0($a3)				# erase back of fireball
	sw $s5, 0($a1)
	lw $s5, 516($a3)
	sw $s5, 516($a1)
	lw $s5, 1024($a3)
	sw $s5, 1024($a1)
	
	beqz $a0, updated_position_enemy
	add $a1, $a1, 4				# update position
	sw $a1, hero_fireball
	j updated_position

	updated_position_enemy:
	add $a1, $a1, 4				# update position
	sw $a1, enemy_fireball

	updated_position:
	j draw_fireball_right

fireball_left:
	bltz $a2, start_fireball_left
	beqz $a2, clear_fireball_left
	bgtz $a2, update_fireball_left

	start_fireball_left:
	beqz $a0, start_enemy_fireball_left
	li $s7, MAX_FIREBALL
	sw $s7, hero_fireball+4
	li $s7, 0
	sw $s7, hero_fireball+8
	add $a1, $t0, 1500	# starting position of fireball
	j getting_fireball_level_left

	start_enemy_fireball_left:
	li $s7, MAX_ENEMY_FIREBALL
	sw $s7, enemy_fireball+4
	li $s7, 0
	sw $s7, enemy_fireball+8
	move $s0, $t6
	add $a1, $s0, 988	# starting position of fireball
	j getting_fireball_level_left

	getting_fireball_level_left:
	li $s7, BASE_ADDRESS
	sub $s7, $a1, $s7	# get fireball offset
	add $a3, $a3, $s7	# add to current level

	draw_fireball_left:
	beqz $a0, draw_enemy_fireball_left
	sw $a1, hero_fireball
	li $s7, 3		# i = height
	la $t5, hero_projectile
	j fireball_height_left

	draw_enemy_fireball_left:
	sw $a1, enemy_fireball
	li $s7, 3		# i = height
	la $t5, enemy_projectile

	fireball_height_left:
	li $s6, 5		# j = width

	fireball_width_left:
	# draw $a0 at position $a1, filling up the gaps using $a3
	lw $s2, ($t5)
	beq $s2, 0x000000, fill_fireball_left
	sw $s2, ($a1)
	j continue_drawing_fireball_left
	fill_fireball_left:
	lw $s2, ($a3)
	sw $s2, ($a1)

	continue_drawing_fireball_left:
	add $t5, $t5, 4		# move to next pixel
	add $a1, $a1, -4
	add $a3, $a3, -4
		
	addi $s6, $s6, -1
	bnez $s6, fireball_width_left	# break if i == 0
	
	add $a1, $a1, 532	# move to next line
	add $a3, $a3, 532
	
	addi $s7, $s7, -1
	bnez $s7, fireball_height_left	# break if j == 0
	beqz $a0, next_enemy
	j check_enemy

	clear_fireball_left:
	beqz $a0, clear_fireball_enemy_left
	li $s1, -1
	sw $s1, hero_fireball+4
	sw $s1, hero_fireball+8
	sw $zero, hero_fireball
	j cleared_fireball_left

	clear_fireball_enemy_left:
	li $s1, -1
	sw $s1, enemy_fireball+4
	sw $zero, enemy_fireball

	cleared_fireball_left:
	li $s7, BASE_ADDRESS
	sub $s7, $a1, $s7	# get offset of fireball
	add $a3, $a3, $s7	# add to current level

	li $s7, 3		# i = height

	clear_fireball_height_left:
	li $s6, 5		# j = width

	clear_fireball_width_left:
	# get level and load to screen
	lw $s2, ($a3)
	sw $s2, ($a1)

	add $a1, $a1, -4	# move to next pixel
	add $a3, $a3, -4
		
	addi $s6, $s6, -1
	bnez $s6, clear_fireball_width_left	# break if i == 0
	
	add $a1, $a1, 532	# move to next line
	add $a3, $a3, 532
	
	addi $s7, $s7, -1
	bnez $s7, clear_fireball_height_left	# break if j == 0
	beqz $a0, next_enemy
	j check_enemy

	update_fireball_left:
	beqz $a0, updated_fireball_left_enemy
	add $a2, $a2, -1
	sw $a2, hero_fireball+4
	j updated_fireball_left

	updated_fireball_left_enemy:
	add $a2, $a2, -1
	sw $a2, enemy_fireball+4

	updated_fireball_left:
	# used for edge detection
	li $s7, 512
	
	li $s2, 3
	addi $s3, $a1, -20
	check_fireball_left:		# check color left of character
	lw $s5, ($s3)
	div $s3, $s7		# hero pos
	mfhi $t9
	beqz $t9, clear_fireball_left		# screen detection
	beq $s5, DOUBLE_JUMP, clear_fireball_left	# check for doublejump powerup
	beq $s5, TELEPORT, clear_fireball_left	# check for teleport powerup
	beq $s5, FIREBALL, clear_fireball_left # check for fireball powerup
	beq $s5, PLATFORM, clear_fireball_left # platform detection
	beq $s5, SPIKE, clear_fireball_left	# spike detection
	beq $s5, PORTAL, clear_fireball_left	# portal detection
	beq $s5, PORTAL2, clear_fireball_left
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_fireball_left

	li $s7, BASE_ADDRESS
	sub $s7, $a1, $s7	# get offset of fireball
	add $a3, $a3, $s7	# add to current level

	lw $s5, 0($a3)				# erase back of fireball
	sw $s5, 0($a1)
	lw $s5, 508($a3)
	sw $s5, 508($a1)
	lw $s5, 1024($a3)
	sw $s5, 1024($a1)

	beqz $a0, final_fireball_left
	add $a1, $a1, -4				# update position
	sw $a1, hero_fireball
	j final_fireball

	final_fireball_left:
	add $a1, $a1, -4				# update position
	sw $a1, enemy_fireball

	final_fireball:
	j draw_fireball_left

jump:
	beqz $a0, doublejump_off		# user did not press jump key (meaning continuation of previous jump)
	lw $s0, jump_cycle
	bltz $s0, doublejump_off		# user pressed jump key but is on the ground
	lw $s1, curr_powerup
	beq $s1, $a0, start_jump	# user pressed jump key, is in the air, and double jump is on
	j doublejump_off

	# doublejump_on:
	# sw $zero, curr_powerup
	# j start_jump

	doublejump_off:
	lw $t2, jump_cycle
	beqz $t2, gravity		# currently in air, no more jump left
	bltz $t2, start_jump	# landed on ground, can jump again
	bgtz $t2, update_jump	# is currently jumping
	
	start_jump:
	li $t2, MAX_JUMP
	sw $t2, jump_cycle
	j continue_jump
		
	update_jump:
	add $t2, $t2, -1
	sw $t2, jump_cycle
	
	continue_jump:		
	lw $t2, direction	# character direction
	beqz $t2, jump_left
	beq $t2, 1, jump_right
	
	j check_fireball
	
reset_jump:
	li $t2, -1
	sw $t2, jump_cycle	# capable of jumping
	j check_fireball
	
jump_right:
	li $t9, BASE_ADDRESS	# only move up if character is not at the top of the screen
	add $t9, $t9, 6656
	ble $t0, $t9, resume	# hero pos <= 508 offset ==> top of screen

	# edge detection			
	li $s2, 9
	addi $s3, $t0, -512
	check_up_right:		# check color above character
	lw $s0, ($s3)
	beq $s0, DOUBLE_JUMP, doublejump # check for doublejump powerup
	beq $s0, TELEPORT, teleport	# check for teleport powerup
	beq $s0, FIREBALL, fireball # check for fireball powerup
