	beq $s0 ENEMY_GREEN, hit
	beq $s0 ENEMY_BLUE, hit
	add $s3, $s3, 4
	add $s2, $s2, -1
	bnez $s2, check_up_right

	# erase headband
	lw $t9, 0($t1)
	sw $t9, 0($t0)
	lw $t9, 516($t1)
	sw $t9, 516($t0)
	lw $t9, 1024($t1)
	sw $t9, 1024($t0)
	
	# erase bottom
	li $s2, 7
	add $s3, $t0, 3592
	add $s4, $t1, 3592
	erase_down_right:
	lw $t9, ($s4)	# get color beneath old position
	sw $t9, ($s3)
	add $s3, $s3, 4
	add $s4, $s4, 4
	add $s2, $s2, -1
	bnez $s2, erase_down_right

	addi $t0, $t0, -512	# new position
	addi $t1, $t1, -512	# new color
	move $a0, $t0
	move $a1, $t1
	
	jal hero_right
	
	j check_fireball
	
jump_left:
	li $t9, BASE_ADDRESS	# only move up if character is not at the top of the screen
	add $t9, $t9, 6656
