	move $a1, $t0

	# used for edge detection
	li $t9, 512		# only move left if character is not at the left of the screen
	addi $t8, $a0, -36
	div $t8, $t9		# hero pos % 512 == 0 => char is at the left of screen
	mfhi $t9
	beqz $t9, else
	
