gravity:
	lw $t2, direction
	beqz $t2, gravity_left
	beq $t2, 1, gravity_right

	j check_fireball
	
gravity_right:
	li $t9, BASE_ADDRESS	# only move down if character is not on floor
	add $t9, $t9, 60412	# hero pos => 60412 offset => floor

	li $s2, 9
	addi $s3, $t0, 4096
	check_gravity_right:		# check color beneath character
	lw $s0, ($s3)
	bge $s3, $t9, reset_jump	# check ground
	beq $s0, DOUBLE_JUMP, doublejump	# check for doublejump powerup
	beq $s0, TELEPORT, teleport	# check for teleport powerup
	beq $s0, FIREBALL, fireball # check for fireball powerup
	beq $s0, PLATFORM, reset_jump	# check platform
	beq $s0, SPIKE, hit	# spike detection
	beq $s0, PORTAL, next_level	# portal detection
	beq $s0, PORTAL2, next_level
	beq $s0 ENEMY_FIREBALL, hit
	beq $s0 ENEMY_COLOR, hit
	beq $s0 ENEMY_RED, hit
	beq $s0 ENEMY_GREEN, hit
	beq $s0 ENEMY_BLUE, hit
	add $s3, $s3, 4
	add $s2, $s2, -1
	bnez $s2, check_gravity_right

	# erase headband
	lw $t9, 0($t1) 		# clear current location by recoloring it
	sw $t9, 0($t0)
	lw $t9, 516($t1)
	sw $t9, 516($t0)
	lw $t9, 1024($t1)
	sw $t9, 1024($t0)
	
	# erase top	
	li $s2, 9
	move $s3, $t0
	move $s4, $t1
	erase_up_right:
	lw $t9, ($s4)
	sw $t9, ($s3)
	add $s3, $s3, 4
	add $s4, $s4, 4
	add $s2, $s2, -1
	bnez $s2, erase_up_right

	addi $t0, $t0, 512	# new position
	addi $t1, $t1, 512	# new position
	move $a0, $t0		# current position
	move $a1, $t1
	
	jal hero_right
	
	j check_fireball
	
gravity_left:
	li $t9, BASE_ADDRESS	# only move down if character is not on floor
	add $t9, $t9, 60412		# hero pos => 60412 offset => floor
	
	li $s2, 9
	addi $s3, $t0, 4096
	check_gravity_left:		# check color beneath character
	lw $s0, ($s3)
	beq $s0, DOUBLE_JUMP, doublejump	# check for doublejump powerup
	beq $s0, TELEPORT, teleport	# check for teleport powerup
	beq $s0, FIREBALL, fireball # check for fireball powerup
	beq $s0, PLATFORM, reset_jump	# check platform
	bge $s3, $t9, reset_jump	# check ground
	beq $s0, SPIKE, hit	# spike detection
	beq $s0, PORTAL, next_level	# portal detection
	beq $s0, PORTAL2, next_level
	beq $s0 ENEMY_FIREBALL, hit
	beq $s0 ENEMY_COLOR, hit
	beq $s0 ENEMY_RED, hit
	beq $s0 ENEMY_GREEN, hit
	beq $s0 ENEMY_BLUE, hit
	add $s3, $s3, -4
	add $s2, $s2, -1
	bnez $s2, check_gravity_left
	
	# erase headband
	lw $t9, 0($t1) 		# clear current location by recoloring it
	sw $t9, 0($t0)
	lw $t9, 508($t1)
	sw $t9, 508($t0)
	lw $t9, 1024($t1)
	sw $t9, 1024($t0)

	# erase top
	li $s2, 9
	move $s3, $t0
	move $s4, $t1
	erase_up_left:
	lw $t9, ($s4)
	sw $t9, ($s3)
	add $s3, $s3, -4
	add $s4, $s4, -4
	add $s2, $s2, -1
	bnez $s2, erase_up_left

	addi $t0, $t0, 512	# new position
	addi $t1, $t1, 512	# new color
