# offset + level number
# type: 0 = shooting, 1 = moving
# direction: 0 = left, 1 = right

# $a0, BASE_ADDRESS
# $a1, enemies address
# $a2, enemies length
# $a3, current level
draw_enemies:
	enemies_loop:
	# first byte
	lw $s1, ($a1)

	lw $a3, level
	
	li $t8, 4
	div $s1, $t8
	mfhi $s2		# level number is remainder
	
	move $t3, $a1
	move $t4, $a2
	bne $s2, $a3, next_enemy

	sub $s3, $s1, $s2			# enemy offset
	add $s3, $s3, BASE_ADDRESS	# enemy position

	lw $s2, 4($a1)				# enemy type
	beqz $s2, enemy_shooting	# enemy type is moving

	enemy_moving:
	lw $t9, enemy_movement+4	# enemy position
	beqz $t9, use_orig_loc
	use_new_loc:
	add $t9, $t9, BASE_ADDRESS
	move $s3, $t9

	use_orig_loc:
	lw $s4, enemy_movement		# enemy distance
	bgez $s4, update_enemy_moving
	li $t9, -2
	beq $s4, $t9, next_enemy	# if enemy was hit by fireball, they cannot spawn again

	initial_enemy_moving:
	lw $a2, 8($a1)				# enemy direction
	lw $a3, enemy_movement		# moving_distance
	move $a1, $s3				# enemy position

	beqz $a2, draw_enemy_left	# 0 = left
	bgtz $a2, draw_enemy_right	# 1 = right
	j resume

	update_enemy_moving:
	move $a0, $a1				# enemies address
	lw $a2, enemy_movement+8	# enemy direction
	lw $a3, enemy_movement		# moving_distance
	move $a1, $s3				# enemy position
	beqz $a2, move_enemy_left	# 0 = left
	bgtz $a2, move_enemy_right	# 1 = right
	j resume

	enemy_shooting:
	lw $s4, enemy_fireball+8	# enemy fireball orientation
	bgez $s4, update_enemy_shooting	# if player has been created
	li $t9, -2
	beq $s4, $t9, next_enemy	# if enemy was hit by fireball, they cannot spawn again

	initial_enemy_shooting:
	move $t6, $s3
	lw $s4, 8($a1)
	lw $a2, 8($a1)				# enemy direction
	lw $a3, enemy_fireball+4	# shooting_distance
	move $a1, $s3				# enemy position
	beqz $a2, draw_shooting_left	# 0 = left
	bgtz $a2, draw_shooting_right	# 1 = right
	j resume

	update_enemy_shooting:
	li $a0, 0
	move $a1, $s3
	move $t6, $s3		# enemy position
	lw $s4, 8($a1)		# enemy fireball orientation
	j check_enemy_right	# check for fireballs
	j check_enemy_left
	enemy_shooting_safe:
	lw $a1, enemy_fireball
	j use_fireball
	
	next_enemy:			# go to next enemy
	move $a1, $t3
	move $a2, $t4
	add $a1, $a1, 12
	add $a2, $a2, -1
	bnez $a2, enemies_loop
	
	j resume

draw_enemy_right:
	li $s1, MAX_ENEMY_MOVEMENT
	sw $s1, enemy_movement
	move $a3, $s1

	draw_shooting_right:
	move $t9, $a1
	li $v0, 42	# get random color
	li $a0, 0
	li $a1, 3
	syscall
	move $a1, $t9

	beqz $a0, get_red_right
	li $s3, 1
	beq $a0, $s3, get_green_right
	li $s3, 2
