# $a0, enemy address
# $a1, enemy position
# $a2, enemy direction
# $a3, enemy moving_distance
move_enemy_right:
	bltz $a3, draw_enemy_right
	beqz $a3, switch_enemy_left
	move $t5, $a0
	lw $a0, ($a1)	# get color of enemy's head to be used for updating
	
	check_enemy_right:
	# check for fireball in front
	li $s2, 7
	addi $s3, $a1, 28
	check_enemy_right1:		# check color right of character
	lw $s0, ($s3)
	beq $s0, HERO_FIREBALL, clear_enemy_right	# check for hero fireball
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_enemy_right1

	# check for fireball behind
	li $s2, 7
	addi $s3, $a1, -4
	check_enemy_right2:		# check color right of character
	lw $s0, ($s3)
	beq $s0, HERO_FIREBALL, clear_enemy_right	# check for hero fireball
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_enemy_right2

	beqz $a0, check_enemy_left	# check fireball on left
	j erase_left_part

	erase_left_part:
	# erase left part
	li $s2, 7
	jal get_level
	add $s3, $a1, -BASE_ADDRESS	# get offset of enemy
	add $s3, $v0, $s3	# get position of enemy
	move $s4, $a1
	erase_enemy_right:		# erase enemy left
	lw $s0, ($s3)
	sw $s0, ($s4)
	add $s3, $s3, 512
	add $s4, $s4, 512
	add $s2, $s2, -1
	bnez $s2, erase_enemy_right

	add $a3, $a3, -1		# update enemy distance
	sw $a3, enemy_movement
	add $a1, $a1, 4			# update position
	
	add $s6, $a1, -BASE_ADDRESS	# get offset
	sw $s6, enemy_movement+4	# update enemy position

	j continue_enemy_right

	switch_enemy_left:
	sw $zero, enemy_movement+8	# switch direction
	add $a1, $a1, 24
	j move_enemy_left

clear_enemy_right:
	beqz $a0, clear_shooting	# if shooting got hit
	clear_moving:				# if moving got hit
	li $s3, -2
	sw $s3, enemy_movement
	j actual_clearing

	clear_shooting:
	li $s3, -2
	sw $s3, enemy_fireball+8
	j actual_clearing

	actual_clearing:
	jal get_level
	add $s3, $a1, -BASE_ADDRESS	# get offset of enemy
	add $s3, $v0, $s3	# get position of enemy in level

	li $s7, 7
	erase_enemy_height:
	li $s2, 7
	erase_enemy_width:
	lw $s0, ($s3)
	sw $s0, ($a1)
	add $s3, $s3, 4
	add $a1, $a1, 4
	add $s2, $s2, -1
	bnez $s2, erase_enemy_width

	add $s3, $s3, 484
	add $a1, $a1, 484
	add $s7, $s7, -1
	bnez $s7, erase_enemy_height
	j next_enemy

# $a0, enemy address
# $a1, enemy position
# $a2, enemy direction
# $a3, enemy moving_distance
move_enemy_left:	
	bltz $a3, draw_enemy_left
	li $s0, MAX_ENEMY_MOVEMENT
	beq $a3, $s0, switch_enemy_right
	move $t5, $a0
	lw $a0, ($a1)	# get color
	
	check_enemy_left:
	# check for fireball in front
	li $s2, 7
	addi $s3, $a1, -28
	check_enemy_left1:		# check color left of character
	lw $s0, ($s3)
	beq $s0, HERO_FIREBALL, clear_enemy_left	# check for hero fireball
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_enemy_left1

	# check for fireball behind
	li $s2, 7
	addi $s3, $a1, 4
	check_enemy_left2:		# check color left of character
	lw $s0, ($s3)
	beq $s0, HERO_FIREBALL, clear_enemy_left	# check for hero fireball
	add $s3, $s3, 512
	add $s2, $s2, -1
	bnez $s2, check_enemy_left2

	beqz $a0, enemy_shooting_safe	# jump back to original if there is no fireball
	j erase_right_part

	erase_right_part:
	# erase right part
	li $s2, 7
	jal get_level
	add $s3, $a1, -BASE_ADDRESS	# get offset of enemy
	add $s3, $v0, $s3	# get position of enemy in level
	move $s4, $a1
	erase_enemy_left:		# erase enemy right
	lw $s0, ($s3)
	sw $s0, ($s4)
	add $s3, $s3, 512
	add $s4, $s4, 512
	add $s2, $s2, -1
	bnez $s2, erase_enemy_left
	
	add $a3, $a3, 1
	sw $a3, enemy_movement			# update enemy distance
	add $a1, $a1, -4			# update position

	add $s6, $a1, -BASE_ADDRESS	# get offset
	sw $s6, enemy_movement+4	# update enemy position

	j continue_enemy_left

	switch_enemy_right:
	li $s0, 1
	sw $s0, enemy_movement+8	# switch direction
	add $a1, $a1, -24
	j move_enemy_right

clear_enemy_left:
	add $a1, $a1, -24
	j clear_enemy_right

# each powerup is composed of offset + level number
# powerup % 4 = level number
# number after powerup indicates type

# $a0, BASE_ADDRESS
# $a1, powerup address
# $a2, powerup length (in terms of 2 words)
# $a3, current level
draw_powerups:
	powerups_loop:
	# first byte
	lw $s1, ($a1)
	
	li $t8, 4
	div $s1, $t8
	mfhi $s2		# level number is remainder
	
	bne $s2, $a3, next_powerup
	
	sub $s5, $s1, $s2	# powerup offset
	
	lw $s3, 4($a1)		# powerup type

	lw $s0, level
	li $t9, 1
	li $t8, 2
	li $t7, 3
	beq $s0, $t9, get_level1_p
	beq $s0, $t8, get_level2_p
	beq $s0, $t7, get_level3_p

	# grab the current level
	get_level1_p:
	la $v0, level_1
	j continue_powerup
	get_level2_p:
	la $v0, level_2
	j continue_powerup
	get_level3_p:
	la $v0, level_3
	j continue_powerup
	
	continue_powerup:
	move $s2, $v0

	# correct powerup color to draw
	powerup_color:
	beq $s3, $t9, draw_double_jump
	beq $s3, $t8, draw_teleport
	beq $s3, $t7, draw_fireball

	draw_double_jump:
	la $s3, doublejump_powerup
	j draw_powerup
	draw_teleport:
	la $s3, teleport_powerup
	j draw_powerup
	draw_fireball:
	la $s3, fireball_powerup
	j draw_powerup

	# draw powerup
	draw_powerup:
	add $s2, $s2, $s5	# position in level
	add $s5, $s5, $a0	# powerup position
	
	li $s7, 9		# i = height

	draw_powerup_height:
	li $s6, 7		# j = width

	draw_powerup_width:
	# draw $s3 at position $s5, filling up the gaps using $s2
	lw $s1, ($s3)
	beq $s1, 0x000000, fill_bg
	sw $s1, ($s5)
	j continue_drawing_powerup
	fill_bg:
	lw $s1, ($s2)
	sw $s1, ($s5)

	continue_drawing_powerup:
	add $s3, $s3, 4		# move to next pixel
	add $s2, $s2, 4
	add $s5, $s5, 4
		
	addi $s6, $s6, -1
	bnez $s6, draw_powerup_width	# break if i == 0
	
	add $s2, $s2, 484	# move to next line
	add $s5, $s5, 484
	
	addi $s7, $s7, -1
	bnez $s7, draw_powerup_height	# break if j == 0
	
	next_powerup:			# go to next powerup
	add $a1, $a1, 8
	add $a2, $a2, -1
	bnez $a2, powerups_loop
	
	jr $ra

# $a0, BASE_ADDRESS
# $a1, powerup address
# $a2, powerup length (in terms of 2 words)
# $a3, current level
# $s0, powerup type
clear_powerup:
	clear_powerups_loop:
	lw $s0, curr_powerup
	# first byte
	lw $s1, ($a1)
	
	li $t8, 4
	div $s1, $t8
	mfhi $s2		# level number is remainder
	
	bne $s2, $a3, next_powerup_remove
	
	sub $s5, $s1, $s2	# powerup offset
	
	lw $s3, 4($a1)		# powerup type

	bne $s3, $s0, next_powerup_remove
	
	jal get_level
	move $s2, $v0

	# remove powerup
	remove_powerup:	
	add $s2, $s2, $s5	# position in level
	add $s5, $s5, $a0

	li $s7, 9		# i = height

	clear_powerup_height:
	li $s6, 7		# j = width

	clear_powerup_width:
	# clear $s3 at position $s5, by filling up the gaps using $s2
	lw $s1, ($s2)
	sw $s1, ($s5)

	continue_clearing_powerup:
	add $s2, $s2, 4
	add $s5, $s5, 4
		
	addi $s6, $s6, -1
	bnez $s6, clear_powerup_width	# break if i == 0
	
	add $s2, $s2, 484	# move to next line
	add $s5, $s5, 484
	
	addi $s7, $s7, -1
	bnez $s7, clear_powerup_height	# break if j == 0
	
	next_powerup_remove:			# go to next powerup
	add $a1, $a1, 8
	add $a2, $a2, -1
	bnez $a2, clear_powerups_loop
	
	j resume

draw_lives:	
	# draw hearts
	li $s1, BASE_ADDRESS
	add $s1, $s1, 520

	lw $s4, lives

	paint_hearts:
	la $s0, heart
	li $s7, 10

	paint_heart_height:
	li $s6, 11

	paint_heart_width:
	lw $s5, ($s0)
	sw $s5, ($s1)
	add $s0, $s0, 4
	add $s1, $s1, 4

	add $s6, $s6, -1
	bnez $s6, paint_heart_width

	add $s1, $s1, 468

	add $s7, $s7, -1
	bnez $s7, paint_heart_height

	add $s4, $s4, -1
	add $s1, $s1, -5068
	bnez $s4, paint_hearts

	jr $ra

powerup_text:
	# draw text
	li $s1, BASE_ADDRESS
	add $s2, $s1, 6140	 # end of screen
	li $s3, 512
	add $s1, $s1, 160

	lw $s6, curr_powerup
