	add $s0, $s0, 4
	add $s1, $s1, 4

	div $s1, $s3
	mfhi $s4
	li $s5, 508
	beq $s4, $s5, paint_text_newline
	bne $s1, $s2, paint_text

	paint_text_newline:
	add $s1, $s1, 164
	ble $s1, $s2, paint_text

	jr $ra

